import React from 'react';
import ReactDOM from 'react-dom';
import App from "./App";
import Shuffle from './components/Shuffle';

const rootElement = document.getElementById("root");
ReactDOM.render(
  <React.StrictMode>
    <App />
    <Shuffle />
  </React.StrictMode>,
  rootElement
);
